Similar to intersperse but with a list of values.

# Example
```
let ls = @list.of([
   @list.of([1, 2, 3]),
   @list.of([4, 5, 6]),
   @list.of([7, 8, 9]),
])
let r = ls.intercalate(@list.of([0]))
assert_eq!(r, @list.of([1, 2, 3, 0, 4, 5, 6, 0, 7, 8, 9]))
```
